import React, { useEffect, useState, Fragment } from "react";
import { Link } from "react-router-dom";
import { Jumbotron, Container, Image} from "react-bootstrap";
import styles from "../CSS/Category.module.css";
import code from "../../commons/Assets/imagemLogo.png";

export default function Category() {
  const [products, setProducts] = useState([]);

  useEffect( () => {
    fetch("http://localhost:8080/categorys/")
      .then((response) => {
        return response.json()
      })
      .then((data) => {
        setProducts(data || [])
      })
  }, [])

  return (
    <Jumbotron id="about" className={styles.Jumbotron} fluid>
      <Container>
        <div className={styles.card}>
          <h1 className={styles.heading}>
            <span className={styles.Us}>Main Category</span>
          </h1>
          <div className={styles.links}>
            {products.map((product) =>{
              return(
                <div key={product.categoryId} className={styles.linkWithImage}>
                  <Image src="https://i.imgur.com/yU6MkEg.png" alt="Logo" style={{ maxHeight: "36px", alignSelf: "center", marginLeft: "10px", paddingBottom: "4px"  }}></Image>
                  <Link className={styles.categoryLink} to={`/category/${product.categoryId}`} key={product.categoryId}>{product.name}</Link> <p>testee</p>
                  <br/>
                </div>
              )
            })}
          </div>
        </div>
      </Container>
      <div className={styles.lineGrade} ></div>
    </Jumbotron>
  );
}
